import React from 'react';
import './App.css';

function App() {
  let url = 'http://localhost:8000/user/'
const data = fetch(url)
  .then(response => response.json())
  .then(data => console.log(data))
  .catch(error => console.error(error));

  console.log(data)
  return (
    <div className="App">
   {data.map(data => <p>{data.name}</p>)}
    </div>
  );
}

export default App;
